Day 1 - See the USA by Train

Today is the start of our 18 day, 29 state, 4 time zones, 8 cities, tour of the USA on Amtrak. We left Saint Paul Union Depot about one hour late on the Empire Builder to Chicago. We will travel through Minnesota, Wisconsin, and Illinois on this leg of the See the USA challenge. We booked a roomette, it is really nice to have your own space to relax plus as a bonus all sleeper cars include meals. We just made it in time for breakfast and enjoyed a leisurely lunch. 

The staff aboard have been amazing, our room steward moved us so that we had great views of the Mississippi River and our breakfast and lunch server made sure we left very full. Thank you Marcelo and Linda for making our short 7 hour trip to Chicago delightful. 

In Chicago we had four hours and after dropping our bags at the lounge (nice perk for sleepers) we headed out for a six mile walk along the river to Navy Pier, and then back along the lakeshore and through downtown. We even came across a car fire on lakeshore blvd, that was a sight to see.

Now on the Lakeshore Limited to Boston. It is kind of amazing how different the space is between the two trains. This is a pinch bigger and taller and has a small sink and toilet (kind of odd for the size of the room) but at least there is a place for our luggage in this roomette. It's now 10 pm and we are about to spring ahead to the Eastern Time Zone making it 11 pm. With a 4:30 wake up call, it's been a full day. 

Next is to experience sleeping on the train. We're figuring out how to configure the beds and off to dream land. Tomorrow we will cover several more states before arriving Boston tomorrow night. 

Thank you joining us on this amazing journey. Good night and we will share more tomorrow from the Lake Shore Limited. 

Auf Wiedersehen

.
