Mas, nessa sexta feira fria aqui em SP eu quero te contar sobre a minha memória afetiva em relação a estes brigadeiros sem leite!

A jornada da alergia me trouxe algumas amigas, me REdefiniu como pessoa e profissional...

Enquanto estávamos entendendo as alergias do Davi, eu passava madrugadas na cozinha ou no face conversando com a "old school" da alergia! A gente desabafava, filosofava, chorava e ria! Ríamos mais  do que chorávamos! E nessas madrugadas eu aprendi a enxergar a alergia de maneira mais leve.

Aprendi a respeitar as limitações do Davi com seriedade. Mas com leveza também. E quem me ensinou e enxergar o copo meio CHEIO foi a @bellotto_monica
.
Que além de me abraçar (mesmo me chacoalhando vez ou outra), ela foi uma das maiores incentivadoras do brigadeiro ideal!

Ela me ATORMENTOU até chegar no brigadeiro delícia.

A gente teorizou muito sobre a vida, os IGEs, IGGs, e sobre a textura do brigadeiro sem leite 😂.

Hoje eu tenho o maior orgulho de dizer que é um dos MELHORES brigadeiros sem leite (e sem castanhas) do Braseeelllllllll.

E tenho muita gratidão por vc ter aparecido por aqui na hora certa Dona Monica! Nosso branquelo agradece!

Como disse minha prima @primarxrodrigues
(Outra das maiores incentivadoras do meu trampo e com quem aprendo muito também ) 

👉Transformando adversidade em superação. (Frase da Pri -Prima)

E você? Aprendeu oq com a alergia? Me conta!

